def count_valid_substrings(s: str, k: int) -> int:
    n = len(s)
    left = zero_count = one_count = result = 0

    for right in range(n):
        if s[right] == '0':
            zero_count += 1
        else:
            one_count += 1

        while zero_count > k and one_count > k:
            if s[left] == '0':
                zero_count -= 1
            else:
                one_count -= 1
            left += 1

        result += right - left + 1

    return result

